function InsertMovie(props){

    function dialog(){
        const favDialog = document.getElementById('favDialog');
        if(favDialog!= null)
            favDialog.showModal();
    }

    const data = props.data;
    var image = (`../images/${data.image}`);
    console.log(image);
    return(
        <div className="col-6 col-xl-4  mb-2">
            <img className="main-img" src= {data.image} onClick={() => dialog()} />
            {dialog()}
            <dialog id="favDialog">
                <form method="dialog">
                    <button onClick={() => navi()}>watch Online</button>
                    <button onClick={() => navi()}>watch with friends</button>
                </form>
            </dialog>
            <output></output>
            <div>
                <label>{data.title}</label>
            </div>

        </div>

    )

};

export default InsertMovie;
